playstore_details.description:
Kienlongbank eToken là ứng dụng để lấy mã xác thực (OTP) giao dịch và gắn duy nhất với tài khoản đăng nhập Internet Banking của khách hàng, được cài đặt ngay trên thiết bị di động của Khách hàng. Kienlongbank eToken là phương thức xác thực công nghệ hiện đại, bảo mật nhất hiện nay được Kienlongbank áp dụng trong các giao dịch Internet Banking, thể hiện cam kết an toàn - bảo mật tối đa, mang lại cho khách hàng những trải nghiệm hoàn toàn hài lòng với những đặc điểm nổi bật như:

- Miễn Phí 100%, thay thế phương thức xác thực giao dịch truyền thống OTP SMS;
- An toàn & bảo mật hơn với mọi giao dịch trực tuyến;
- Ổn định, sử dụng được ngay cả khi không có sóng điện thoại, công tác nước ngoài;
- Thuận tiện & dễ dàng hơn khi có thể lấy mã OTP ngay cả khi thiết bị di động không có kết nối trực tuyến;
- Đăng ký dễ dàng qua Internet Banking của Kienlongbank.
